define({"topics":[{"title":"<ph>5.1<\/ph>\nZigbee Project Generation","shortdesc":"<p class=\"shortdesc\">There are different zigbee device types supported in Microchip Zigbee framework. Few         sample application projects are available as reference <span class=\"ph\">&lt;Harmony Content         Path&gt;\\wireless_apps_pic32cxbz2_wbz45<\/span>\\apps\\zigbee . The projects for         other device types can be generated by following the step by step procedure in this         document.<\/p>","href":"GUID-B70D4611-9448-4ACC-99C6-308B8EC2BEB7.html","attributes":{"data-id":"GUID-B70D4611-9448-4ACC-99C6-308B8EC2BEB7"},"menu":{"hasChildren":false},"tocID":"GUID-B70D4611-9448-4ACC-99C6-308B8EC2BEB7-d1763e496","topics":[]},{"title":"<ph>5.2<\/ph>\nZigbee Console Commands","shortdesc":"<p class=\"shortdesc\">Zigbee Serial console commands<\/p>","href":"GUID-BA19A3F8-CCEB-44C2-B5BF-C203DD6A8D41.html","attributes":{"data-id":"GUID-BA19A3F8-CCEB-44C2-B5BF-C203DD6A8D41"},"menu":{"hasChildren":false},"tocID":"GUID-BA19A3F8-CCEB-44C2-B5BF-C203DD6A8D41-d1763e510","topics":[]},{"title":"<ph>5.3<\/ph>\nZigbee Commisioning Procedure","shortdesc":"<p class=\"shortdesc\">Commissioning is the process of initializing the devices to join a network and to work together. The Zigbee Base Device Behaviour specification specifies the procedures for the following commissioning mechanisms which are executed in the order as given given below<\/p>","href":"GUID-7E62A1F7-3B35-4B5A-86DA-F5694100F9E8.html","attributes":{"data-id":"GUID-7E62A1F7-3B35-4B5A-86DA-F5694100F9E8"},"menu":{"hasChildren":false},"tocID":"GUID-7E62A1F7-3B35-4B5A-86DA-F5694100F9E8-d1763e521","topics":[]},{"title":"<ph>5.4<\/ph>\nZigbee Network Security Models","href":"GUID-C8CD15B7-2156-4EF8-8D55-C879C829A34B.html","attributes":{"data-id":"GUID-C8CD15B7-2156-4EF8-8D55-C879C829A34B"},"menu":{"hasChildren":false},"tocID":"GUID-C8CD15B7-2156-4EF8-8D55-C879C829A34B-d1763e532","topics":[]},{"title":"<ph>5.5<\/ph>\nZigbee Green Power","shortdesc":"<p class=\"shortdesc\">Green Power is a feature of Zigbee that allows for energy-harvesting technology to be used directly with the Zigbee stack. Green Power is the global wireless standard for large installations where changing batteries and accessing devices becomes costly.<\/p>","href":"GUID-E7EBE9A5-6B89-4D7A-9620-AE652F4FB0A8.html","attributes":{"data-id":"GUID-E7EBE9A5-6B89-4D7A-9620-AE652F4FB0A8"},"menu":{"hasChildren":false},"tocID":"GUID-E7EBE9A5-6B89-4D7A-9620-AE652F4FB0A8-d1763e540","topics":[]},{"title":"<ph>5.6<\/ph>\nZigBee OTA Sniffer","href":"GUID-285C63CD-E7E3-492F-B820-5C6C5CB3F36E.html","attributes":{"data-id":"GUID-285C63CD-E7E3-492F-B820-5C6C5CB3F36E"},"menu":{"hasChildren":false},"tocID":"GUID-285C63CD-E7E3-492F-B820-5C6C5CB3F36E-d1763e551","topics":[]},{"title":"<ph>5.7<\/ph>\nZigBee Applications","shortdesc":"<p class=\"shortdesc\">Documentation describing steps to test and develop the precompiled Zigbee application         examples.<\/p>","href":"GUID-ACC1C69A-65C7-45E5-94FD-81BF5B29E381.html","attributes":{"data-id":"GUID-ACC1C69A-65C7-45E5-94FD-81BF5B29E381"},"menu":{"hasChildren":true},"tocID":"GUID-ACC1C69A-65C7-45E5-94FD-81BF5B29E381-d1763e559","next":"GUID-ACC1C69A-65C7-45E5-94FD-81BF5B29E381-d1763e559"}]});